import {
  ContainerAnimation,
  ContainerFloor,
  ContainerMain,
  WapperAnimation,
} from "./AnimationStyle";
import RootSvg from "./RootSvg";

const BoxAnimation = () => {
  return (
    <WapperAnimation>
      <ContainerAnimation>
        <ContainerFloor>
          <ContainerMain>
            <RootSvg />
          </ContainerMain>
        </ContainerFloor>
      </ContainerAnimation>
    </WapperAnimation>
  );
};
export default BoxAnimation;
